import React, { useEffect, useState } from "react";

function Content({ response }) {
  const formatContent = (content) => {
    var something;
    content
      .json()
      .then((data) => {
        console.log(data);
        if (1) {
          return (
            "Your highest mythic keystone is " +
            data["mythic_plus_weekly_highest_level_runs"][0]
          );
        } else {
          return "This character has not completed a mythic keystone for this week!";
        }
      })
      .then((data) => {
        return data;
      });
  };

  var content = "";

  if (response) {
    if (response.ok) {
      content = formatContent(response);
      console.log(response);
    } else {
      content = "there was an error retrieving this character";
    }
  } else {
    content = "There will be content over here";
  }

  return <div>{content}</div>;
}

export default Content;
